import React from 'react'
import CourseItem from '../../components/Courses/CourseItem/CourseItem'

const MyCourses = () => {
  const listCourses = [
    {
      title: 'Flutter for Designers ',
      description: '20 videos - 3 hours',
    },
  ]
  const listItems = listCourses.map((listCourses) => <CourseItem
    customStyles={{ margin: 20 }}
    title={listCourses.title}
    description={listCourses.description}
  />)
  return (
    <ul className="row">
      {listItems}
    </ul>
  )
}
export default MyCourses
